import axios from 'axios'

export default () => {
  axios.get('https://cors-anywhere.herokuapp.com/https://www.arnoldclark.com/used-cars/search.json?payment_type=monthly&min_price=100&max_price=150&sort_order=monthly_payment_up')
  .then((data)=>data.json())
  .then(res => res.data)
  .catch(error => error)
};
